import React, { Component } from 'react'; 
import DurationData from '../../../src/assets/data.json'

class ApplyFilterDuration extends Component {
  render() {
      return (
          <div>
              {DurationData.map((postDetail, index) => {
                  return <h1>{postDetail.title}</h1>
              })}
          </div>
      )
  }
}

export default ApplyFilterDuration;
